import styled from "styled-components";
import { Link } from 'react-router-dom';
import '../App.css';

const MainPage = styled.div`
  background-color: black;
  .da:after{
    content: '';
    background-color: rgba(200,100,50, 0.5);
    z-index: 2;
  }
`

const MainWindow = styled.div`
  width: 500px;
  height: 600px;
  margin: 0 auto;
  margin-top: 300px;
  display: flex;
  background-color: #faf;
`

const SignIn = () => {
  return (
    <MainPage className="da">
      <MainWindow>
        <Link to='/Dashboard'>Домой</Link>
        <p>Ссылка сработала, заебись</p>
      </MainWindow>
    </MainPage>
  );
}

export default SignIn;
